column8:
純正ドアミラーウィンカーのレンズを交換するだけでよりスタイリッシュなドアミラーに！高輝度LED採用で視認性も向上し、安全性もアップ！レンズ中央のチューブがホワイトのデイライトまたはスモールに点灯。ウィンカー使用時にはオレンジの点滅点灯に切り替わります。レンズ底面のホワイトのLEDレンズはウェルカムランプとして点灯します。<br><br>魅力的な3つの機能【機能1】高輝度LED+LEDライトバー2本が発光し、抜群の視認性を発揮します。【機能2】2本のライトバーがホワイトに発光。ウインカー時には消灯し、アンバー色で点滅します。配線方法により、常時点灯またはスモールランプに連動して点灯させることが可能です。【機能3】足元を明るく照らすウエルカムランプは高輝度LEDを使用し、ドアのUNLOCKに連動してウエルカムランプが点灯します。スマートエントリーシステム装着車ではルームランプに連動したウェルカムランプの点灯が可能。<br><br>■6LED　■ウェルカムライト機能　■ウインカー時：オレンジ発光　デイライト/スモール：ホワイト発光　■付属品：配線ｘ２、配線カプラーｘ４　※純正ウインカーミラー装着車用。社外ミラー/ミラーカバー装着車およびウインカーミラー非装着車には取り付けできません。※純正のウインカーレンズと形状が変わるため、ミラーカバー側を多少削る加工が必要になる場合があります。<br><br>対応車種：アイシス(後期H19/5～)・アリオン(H19/6～)・イスト(H19/7～)・ヴィッツ(後期H19/8～H22/12)・オーリス(後期H21/10～)・カローラアクシオ(H18/10～)・カローラフィルダー(H18/10～)・カローラルミオン(H19/10～)・パッソ(H18/12～H22/1)・ブレイド(H18/12～)・プレミオ(H19/6～)・ベルタ(H20/8～)・マークX(H18/10～H21/10)・ダイハツブーン(H18/12～H22/1)<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


